import React, {Component} from 'react';

import './Task.css';

class Task extends Component {
    render () {

        const {task} = this.props;

        return <p className="red">

        {task.title} - 
        {task.description} - 
        {task.done} -
        {task.id} -
        <input type="checkbox" />
        <button style ={btnDelete}>
            x
        </button>
        </p>
    }
}

const btnDelete = {
    fontSize: '18px'
}

export default Task;
